import React from "react";
import { Route, Routes } from "react-router-dom";
import { Login } from "./login/Login";

export const Auth = () => {
  return (
    <div>
      <Routes>
        <Route>
          
        </Route>
        <Route path="/auth/login" element={<Login />} />
      </Routes>
    </div>
  );
};
